const layoutProps = {
  toc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">


    <p>{`RedisInsight is an intuitive and efficient GUI for Redis, allowing you to interact with your databases and manage your data—with built-in support for most popular Redis modules. It is a 100% free Redis GUI tool that allows you to visualise, monitor, and optimize while developing your applications with Redis`}</p>
    <p><img alt={"my image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisinsight.gif").default} /></p>
    <p>{`RedisInsight provides built-in support for the RedisJSON, RediSearch, RedisGraph, Redis Streams, and RedisTimeSeries modules to make it even easier to query, visualize, and interactively manipulate search indexes, graphs, streams, and time-series data. `}</p>
    <p>{`A full-featured pure desktop GUI client, RedisInsight is available for Windows, macOS, and Linux and is fully compatible with Redis Enterprise. It works with any cloud provider as long as you run it on a host with network access to your cloud-based Redis server. RedisInsight makes it easy to discover cloud databases and configure connection details with a single click. It allows you to automatically add Redis Enterprise Software and Redis Enterprise Cloud databases. `}</p>
    <h3 {...{
      "id": "getting-started"
    }}>{`Getting Started`}</h3>
    <Tabs defaultValue="MacOS" values={[{
      label: 'MacOS',
      value: 'MacOS'
    }, {
      label: 'Linux',
      value: 'Linux'
    }, {
      label: 'Windows',
      value: 'Windows'
    }, {
      label: 'Docker',
      value: 'Docker'
    }, {
      label: 'Kubernetes',
      value: 'Kubernetes'
    }]} mdxType="Tabs">
  <TabItem value="MacOS" mdxType="TabItem">
        <h4 {...{
          "id": "using-macos"
        }}>{`Using MacOS`}</h4>
        <h4 {...{
          "id": "step-1-download-redisinsight"
        }}>{`Step 1. Download RedisInsight`}</h4>
        <p>{`To use RedisInsight on a local Mac, you can download from the RedisInsight page on the RedisLabs website:`}</p>
        <p><a parentName="p" {...{
            "href": "https://redislabs.com/redis-enterprise/redis-insight/#insight-form"
          }}>{`Click this link `}</a>{` to access a form that allows you to select the operating system of your choice.`}</p>
        <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisinsightmac.png").default} /></p>
        <p>{`Fill out the rest of the form and click “Download.” Please note that the package name is the combination of the platform and version as shown here:`}</p>
        <p>{`redisinsight-platform-version`}</p>
        <h4 {...{
          "id": "step-2-install-redisinsight"
        }}>{`Step 2. Install RedisInsight`}</h4>
        <p>{`Click on the RedisInsight executable and install it in your system.`}</p>
        <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisinsight2.png").default} /></p>
        <p>{`Head over to your web browser and go to http://localhost:8001`}</p>
        <p>{`Congratulations! You have successfully installed RedisInsight and are now ready to inspect your Redis data, monitor database health, and perform runtime server configuration with this browser-based management interface for your Redis deployment.`}</p>
        <h4 {...{
          "id": "step-3-connect-to-redis-database"
        }}>{`Step 3. Connect to Redis database`}</h4>
        <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisinsight3.png").default} /></p>
        <p>{`Assuming that you already have Redis database up and running, select "Connect to a Redis database"
`}<img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisinsight4.png").default} /></p>
        <h4 {...{
          "id": "step-4-add-redis-database"
        }}>{`Step 4. Add Redis Database`}</h4>
        <p>{`Enter the requested details, including Name, Host (endpoint), Port, and Password in the form, as shown below. You can skip username for now. Then click “ADD REDIS DATABASE”:`}</p>
        <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisinsight5.png").default} /></p>
        <h4 {...{
          "id": "step-5-run-the-redis-cli"
        }}>{`Step 5. Run the Redis CLI`}</h4>
        <p>{`Finally, although RedisInsight is a great GUI, sometimes you want to work directly in the command-line interface (CLI). To do so, click “CLI” in the  menu on the left side of the RedisInsight UI:`}</p>
        <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisinsight7.png").default} /></p>
        <p>{`Then paste the appropriate Redis commands in the command section, marked with “>>” as shown below, and press Enter.`}</p>
        <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisinsight9.png").default} /></p>
        <p>{`You can see the output displayed at the top of the screen. If it says “OK,” the command was executed successfully.`}</p>
      </TabItem>
      <TabItem value="Linux" mdxType="TabItem">
        <h4 {...{
          "id": "using-linux"
        }}>{`Using Linux`}</h4>
        <h4 {...{
          "id": "step-1-download-redisinsight-1"
        }}>{`Step 1. Download RedisInsight`}</h4>
        <p>{`To use RedisInsight on your Linux machine, you can download from the RedisInsight page on the RedisLabs website:`}</p>
        <p>{`Open `}<a parentName="p" {...{
            "href": "https://redislabs.com/redis-enterprise/redis-insight/#insight-form"
          }}>{`this`}</a>{` link to open up a form that allows you to select the operating system of your choice.`}</p>
        <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisinsight-linux.png").default} /></p>
        <p>{`Fill out the rest of the form and click “Download.” Please note that the package name is the combination of the platform and version as shown here:`}</p>
        <p>{`redisinsight-linux64`}</p>
        <h4 {...{
          "id": "step-2-install-redisinsight-1"
        }}>{`Step 2. Install RedisInsight`}</h4>
        <p>{`Open a terminal and navigate to the folder containing the downloaded file.`}</p>
        <p>{`Make your downloaded file into an executable.`}</p>
        <pre><code parentName="pre" {...{}}>{`chmod +x redisinsight-linux64-<version>
`}</code></pre>
        <h4 {...{
          "id": "step-3-start-redisinsight"
        }}>{`Step 3. Start RedisInsight.`}</h4>
        <pre><code parentName="pre" {...{}}>{`./redisinsight-linux64-version
`}</code></pre>
        <p>{`To access your RedisInsight GUI, open a web browser and navigate to `}<a parentName="p" {...{
            "href": "http://127.0.0.1:8001"
          }}>{`http://127.0.0.1:8001`}</a>{`.`}</p>
        <p>{`Congratulations! You have successfully installed RedisInsight and are now ready to inspect your Redis data, monitor database health, and perform runtime server configuration with this browser-based management interface for your Redis deployment.`}</p>
        <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisinsight3.png").default} /></p>
        <h4 {...{
          "id": "step-4-connect-to-redis-database"
        }}>{`Step 4. Connect to Redis database`}</h4>
        <p>{`Assuming that you already have Redis database up and running, select "Connect to a Redis database"
`}<img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisinsight4.png").default} /></p>
        <p>{`Enter the requested details, including Name, Host (endpoint), Port, and Password in the form, as shown below. You can skip username for now. Then click “ADD REDIS DATABASE”:`}</p>
        <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisinsight5.png").default} /></p>
        <h4 {...{
          "id": "step-5-run-the-redis-cli-1"
        }}>{`Step 5. Run the Redis CLI`}</h4>
        <p>{`Finally, although RedisInsight is a great GUI, sometimes you want to work directly in the command-line interface (CLI). To do so, click “CLI” in the  menu on the left side of the RedisInsight UI:`}</p>
        <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisinsight7.png").default} /></p>
        <p>{`Then paste the appropriate Redis commands in the command section, marked with “>>” as shown below, and press Enter.`}</p>
        <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisinsight9.png").default} /></p>
        <p>{`You can see the output displayed at the top of the screen. If it says “OK,” the command was executed successfully.`}</p>
      </TabItem>
      <TabItem value="Windows" mdxType="TabItem">
        <h4 {...{
          "id": "using-windows"
        }}>{`Using Windows`}</h4>
        <h4 {...{
          "id": "step-1-download-redisinsight-2"
        }}>{`Step 1. Download RedisInsight`}</h4>
        <p>{`To install RedisInsight on Windows, there is no need to install any .NET framework. RedisInsight should install and run on a fresh Windows system. `}</p>
        <p>{`To use RedisInsight on your Windows machine, you can download from the RedisInsight page on the RedisLabs website:`}</p>
        <p>{`Open `}<a parentName="p" {...{
            "href": "https://redislabs.com/redis-enterprise/redis-insight/#insight-form"
          }}>{`this`}</a>{` link to open up a form that allows you to select the operating system of your choice.`}</p>
        <h4 {...{
          "id": "step-2--install-redisinsight"
        }}>{`Step 2.  Install RedisInsight`}</h4>
        <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisinsight-windows.png").default} /></p>
        <p>{`Fill out the rest of the form and click “Download.” Please note that the package name is the combination of the platform and version as shown here:`}</p>
        <p>{`redisinsight-win-msi`}</p>
        <h4 {...{
          "id": "step-3-accessing-redisinsight"
        }}>{`Step 3. Accessing RedisInsight`}</h4>
        <p>{`After the web server starts, open `}<a parentName="p" {...{
            "href": "http://127.0.0.1:8001"
          }}>{`http://127.0.0.1:8001`}</a>{` and add a Redis database connection.`}</p>
        <p>{`Congratulations! You have successfully installed RedisInsight and are now ready to inspect your Redis data, monitor database health, and perform runtime server configuration with this browser-based management interface for your Redis deployment.`}</p>
        <h4 {...{
          "id": "step-4-connect-to-a-redis-database"
        }}>{`Step 4. Connect to a Redis database`}</h4>
        <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisinsight3.png").default} /></p>
        <p>{`Assuming that you already have Redis database up and running, select "Connect to a Redis database"
`}<img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisinsight4.png").default} /></p>
        <p>{`Enter the requested details, including Name, Host (endpoint), Port, and Password in the form, as shown below. You can skip username for now. Then click “ADD REDIS DATABASE”:`}</p>
        <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisinsight5.png").default} /></p>
        <h4 {...{
          "id": "step-5-run-the-redis-cli-2"
        }}>{`Step 5. Run the Redis CLI`}</h4>
        <p>{`Finally, although RedisInsight is a great GUI, sometimes you want to work directly in the command-line interface (CLI). To do so, click “CLI” in the  menu on the left side of the RedisInsight UI:`}</p>
        <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisinsight7.png").default} /></p>
        <p>{`Then paste the appropriate Redis commands in the command section, marked with “>>” as shown below, and press Enter.`}</p>
        <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisinsight9.png").default} /></p>
        <p>{`You can see the output displayed at the top of the screen. If it says “OK,” the command was executed successfully.`}</p>
      </TabItem>
      <TabItem value="Docker" mdxType="TabItem">
        <h4 {...{
          "id": "using-docker"
        }}>{`Using Docker`}</h4>
        <h4 {...{
          "id": "step-1-install-docker"
        }}>{`Step 1. Install Docker`}</h4>
        <p>{`The first step is to install docker for your operating system. Run the docker version command in a terminal window to make sure that docker is installed correctly.`}</p>
        <p>{`Note - On Windows and Mac, install docker version 18.03 or higher. You can run docker version to find out your docker version.`}</p>
        <h4 {...{
          "id": "step-2--run-redisinsight-docker-image"
        }}>{`Step 2.  Run RedisInsight Docker image`}</h4>
        <p>{`Next, run the RedisInsight container. The easiest way is to run the following command:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-bash"
          }}>{` docker run -d -v redisinsight:/db -p 8001:8001 redislabs/redisinsight:latest
`}</code></pre>
        <h4 {...{
          "id": "step-3-accessing-redisinsight-1"
        }}>{`Step 3. Accessing RedisInsight`}</h4>
        <p>{`Next, point your browser to http://localhost:8001.`}</p>
        <p>{`RedisInsight also provides a health check endpoint at http://localhost:8001/healthcheck/ to monitor the health of the running container.`}</p>
        <p>{`Note: Make sure the directory you pass as a volume to the container has necessary permissions for the container to access it. For example, if the previous command returns a permissions error, run the following command:`}</p>
        <pre><code parentName="pre" {...{}}>{` chown -R 1001 redisinsight
`}</code></pre>
        <p>{`In addition, you can add some additional flags to the docker run command:`}</p>
        <p>{`You can add the -it flag to see the logs and view the progress.`}</p>
        <p>{`On Linux, you can add --network host. This makes it easy to work with redis running on your local machine.`}</p>
        <p>{`To analyze RDB files stored in S3, you can add the access key and secret access key as environment variables using the -e flag.`}</p>
        <p>{`For example: -e AWS_ACCESS_KEY=aws_access_key -e AWS_SECRET_KEY=aws_secret_access_key`}</p>
        <p>{`If everything worked, you should see the following output in the terminal:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-bash"
          }}>{` Starting webserver...
 Visit http://0.0.0.0:8001 in your web browser.
 Press CTRL-C to exit.
`}</code></pre>
        <p>{`Head over to your web browser and go to http://localhost:8001`}</p>
        <p>{`Congratulations! You have successfully installed RedisInsight and are now ready to inspect your Redis data, monitor database health, and perform runtime server configuration with this browser-based management interface for your Redis deployment.`}</p>
        <h4 {...{
          "id": "step-4-connect-to-a-redis-database-1"
        }}>{`Step 4. Connect to a Redis database`}</h4>
        <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisinsight3.png").default} /></p>
        <p>{`Assuming that you already have Redis database up and running, select "Connect to a Redis database"
`}<img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisinsight4.png").default} /></p>
        <p>{`Enter the requested details, including Name, Host (endpoint), Port, and Password in the form, as shown below. You can skip username for now. Then click “ADD REDIS DATABASE”:`}</p>
        <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisinsight5.png").default} /></p>
        <h4 {...{
          "id": "step-5-run-the-redis-cli-3"
        }}>{`Step 5. Run the Redis CLI`}</h4>
        <p>{`Finally, although RedisInsight is a great GUI, sometimes you want to work directly in the command-line interface (CLI). To do so, click “CLI” in the  menu on the left side of the RedisInsight UI:`}</p>
        <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisinsight7.png").default} /></p>
        <p>{`Then paste the appropriate Redis commands in the command section, marked with “>>” as shown below, and press Enter.`}</p>
        <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./redisinsight9.png").default} /></p>
        <p>{`You can see the output displayed at the top of the screen. If it says “OK,” the command was executed successfully.`}</p>
      </TabItem>
      <TabItem value="Kubernetes" mdxType="TabItem">
        <h4 {...{
          "id": "using-kubernetes"
        }}>{`Using Kubernetes`}</h4>
        <h4 {...{
          "id": "step-1-create-the-redisinsight-deployment-and-service"
        }}>{`Step 1. Create the RedisInsight deployment and service`}</h4>
        <p>{`Below is an annotated YAML file that will create a RedisInsight deployment and a service in a k8s cluster.`}</p>
        <h4 {...{
          "id": "step-2-create-a-new-file-redisinsightyaml-with-the-content-below"
        }}>{`Step 2. Create a new file redisinsight.yaml with the content below`}</h4>
        <pre><code parentName="pre" {...{}}>{` # RedisInsight service with name 'redisinsight-service'
 apiVersion: v1
 kind: Service
 metadata:
   name: redisinsight-service       # name should not be 'redisinsight'
                                   # since the service creates
                                   # environment variables that
                                   # conflicts with redisinsight
                                   # application's environment
                                   # variables \`REDISINSIGHT_HOST\` and
                                   # \`REDISINSIGHT_PORT\`
 spec:
   type: LoadBalancer
   ports:
     - port: 80
       targetPort: 8001
   selector:
     app: redisinsight
---
 ###  RedisInsight deployment with name 'redisinsight'

 apiVersion: apps/v1
 kind: Deployment
 metadata:
   name: redisinsight #deployment name
   labels:
     app: redisinsight #deployment label
 spec:
   replicas: 1 #a single replica pod
   selector:
     matchLabels:
       app: redisinsight #which pods is the deployment managing, as defined by the pod template
   template: #pod template
     metadata:
       labels:
         app: redisinsight #label for pod/s
     spec:
       containers:

       - name:  redisinsight #Container name (DNS_LABEL, unique)
         image: redislabs/redisinsight:1.7.0 #repo/image
         imagePullPolicy: IfNotPresent #Always pull image
         volumeMounts:
         - name: db #Pod volumes to mount into the container's filesystem. Cannot be updated.
           mountPath: /db
         ports:
         - containerPort: 8001 #exposed conainer port and protocol
           protocol: TCP
       volumes:
       - name: db
         emptyDir: {} # node-ephemeral volume https://kubernetes.io/docs/concepts/storage/volumes/#emptydir
`}</code></pre>
        <h4 {...{
          "id": "step-3-create-the-redisinsight-deployment-and-service"
        }}>{`Step 3. Create the RedisInsight deployment and service`}</h4>
        <pre><code parentName="pre" {...{}}>{`kubectl apply -f redisinsight.yaml
`}</code></pre>
        <h4 {...{
          "id": "step-4-accessing-redisinsight"
        }}>{`Step 4. Accessing RedisInsight`}</h4>
        <p>{`Once the deployment and service are successfully applied and complete, you shoould be able to access RedisInsight.
This can be accomplished by listing the using the External IP address of the service we created to reach redisinsight.`}</p>
        <pre><code parentName="pre" {...{}}>{`$ kubectl get svc redisinsight-service
NAME                   CLUSTER-IP       EXTERNAL-IP      PORT(S)         AGE
redisinsight-service   <cluster-ip>     <external-ip>    80:32143/TCP    1m
`}</code></pre>
        <p>{`If you are using minikube, run minikube list to list the service and access RedisInsight at http://minikube-ip:minikube-service-port.`}</p>
        <pre><code parentName="pre" {...{}}>{`$ minikube list
|-------------|----------------------|--------------|---------------------------------------------|
|  NAMESPACE  |         NAME         | TARGET PORT  |           URL                               |
|-------------|----------------------|--------------|---------------------------------------------|
| default     | kubernetes           | No node port |                                             |
| default     | redisinsight-service |           80 | http://minikube-ip:minikubeservice-port |
| kube-system | kube-dns             | No node port |                                             |
|-------------|----------------------|--------------|---------------------------------------------|
`}</code></pre>
        <h4 {...{
          "id": "step-5-create-the-redisinsight-deployment-without-a-service"
        }}>{`Step 5. Create the RedisInsight deployment without a service.`}</h4>
        <p>{`Below is an annotated YAML file that will create a RedisInsight deployment in a K8s cluster.`}</p>
        <h4 {...{
          "id": "create-a-new-file-redisinsightyaml-with-the-content-below"
        }}>{`Create a new file redisinsight.yaml with the content below`}</h4>
        <pre><code parentName="pre" {...{}}>{`apiVersion: apps/v1
kind: Deployment
metadata:
  name: redisinsight #deployment name
  labels:
    app: redisinsight #deployment label
spec:
  replicas: 1 #a single replica pod
  selector:
    matchLabels:
      app: redisinsight #which pods is the deployment managing, as defined by the pod template
  template: #pod template
    metadata:
      labels:
        app: redisinsight #label for pod/s
    spec:
      containers:
      - name:  redisinsight #Container name (DNS_LABEL, unique)
        image: redislabs/redisinsight:1.7.0 #repo/image
        imagePullPolicy: IfNotPresent #Always pull image
        env:
